import React from 'react';
import HeroSection from '../../HeroSection';
import About from '../../About';
import ServicesSection from '../../Services';
import Testimonials from '../../Testimonials';
import Booking from '../Booking';

const Home = () => {
	return (
		<div>
			<HeroSection />
			<ServicesSection />
			<About />
			<Testimonials />
			<Booking />
		</div>
	);
};

export default Home;
